int incremovableSubarrayCount(int* nums, int numsSize) {
    int count = 0;
    // Iterate through all possible subarray lengths
    for (int len = 1; len <= numsSize; ++len) {
        // Iterate through all possible starting points for the current subarray length
        for (int start = 0; start <= numsSize - len; ++start) {
            int prev = -1; // Initialize previous element to -1 (since nums contains positive integers)
            bool isIncreasing = true;
            // Check if removing the current subarray makes the rest of the array strictly increasing
            for (int i = 0; i < numsSize; ++i) {
                // Skip elements that are part of the current subarray
                if (i >= start && i < start + len) continue;
                // Check if the current element is greater than the previous
                if (nums[i] <= prev) {
                    isIncreasing = false;
                    break;
                }
                prev = nums[i];
            }
            // If removing the subarray results in a strictly increasing sequence, increment the count
            if (isIncreasing) count++;
        }
    }
    return count;
}
